import React from 'react';
import "./inks.css";
import pic1 from '../images/a1.jpg';
import pic2 from '../images/a1.jpg';
import pic3 from '../images/a1.jpg';
import PageHeader from '../../Component/PageHeader/PageHeader';
import { useNavigate } from 'react-router-dom';

const Inks = () => {
  const navigate = useNavigate();
  
  const handleContact = () => {
    navigate("/contactus");
  };

  const data = [
    { id: 1, title: "Ink 1", description: "This is the first ink.", image: pic1 },
    { id: 2, title: "Ink 2", description: "This is the second ink.", image: pic2 },
    { id: 3, title: "Ink 3", description: "This is the third ink.", image: pic3 },
  ];

  return (
    <>
      <PageHeader topheading="Inks" title="inks" />

      <div className="container">
        <div className="row mb-2">
          <div className="col-md-2 col-12">
            <h3 className="pt-3 text-center">Products</h3>
            <div className='inkpic'>
              <img src="/images/products/i1.jpg" className='ink-image' alt="" />
            </div>
          </div>
          <div className="col-md-6 col-12">
            <div className="midStamp">
              <h3 className="pt-3 text-center">Stamps</h3>
              <img src="/images/redmohar.jpg" alt="" />
            </div>
          </div>
          <div className="col-md-4 col-12">
            <div className="container">
              <h3 className="pt-3 text-center">Details</h3>
              <div className="cards-container">
                {data.map((item) => (
                  <div key={item.id} className="card">
                    <img src={item.image} alt={item.title} className="card-image" />
                    <div className="card-content">
                      <h3>{item.title}</h3>
                      <p>{item.description}</p>
                      <button onClick={handleContact} className='card-button'> 
                        Details
                      </button>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Inks;













